/*eslint-disable*/

import { useEffect } from "react";

function ShowChart(props) {
  //차트 만들기
  useEffect(() => {
    const script = document.createElement("script");
    script.src = "https://www.gstatic.com/charts/loader.js";
    script.async = true;
    document.body.appendChild(script);
  });

  return (
    <>
      <h1>{props.result}</h1>
    </>
  );
}

export default ShowChart;
